import { makeStyles } from '@material-ui/core/styles'

const useStyles = makeStyles((theme) => ({
    webBlock: {
        paddingTop: 50,
        width: '100%',
        height: '100%',
        backgroundColor: '#aaaaf1',
        backgroundImage: '-webkit-linear-gradient(-60deg, #FFF 50%, #aaaaf1 50%)'
    },
}))

export default useStyles
